INSERT INTO information (id, titre, contenu, auteur, idType, dateCreation) VALUES
(1, 'Ouverture des adhsions 2020-2021', '<p>Bonjour  toutes et  tous,</p><p>La nouvelle saison 2020-2021 commence le 1er septembre. Les adhsions et les r adhsions  l\'amicale du Val de Somme sont dsormais ouvertes, afin que chacun puisse s\'engager dans ses bonnes rsolutions et ses objectifs annuels.&nbsp;</p><p>Mme si bon nombre de comptitions d\'automne sont dj annules  cause de la crise sanitaire, l\'adhsion permet de bnficier de nombreux avantages parmi lesquels :&nbsp;</p><p style=\"margin-left:40px;\">les conseils de coachs forms,&nbsp;</p><p style=\"margin-left:40px;\">le partage d\'expriences de coureurs confirms,&nbsp;</p><p style=\"margin-left:40px;\">des informations multiples sur la course  pied (calendrier, rglements, conseils...),&nbsp;</p><p style=\"margin-left:40px;\">la pratique en groupe qui soutient les pratiquants dans les priodes o la motivation dcline,</p><p style=\"margin-left:40px;\">&nbsp;la participation sous les couleurs du club aux championnats dpartementaux rgionaux et nationaux,&nbsp;</p><p style=\"margin-left:40px;\">les entranements collectifs varis,&nbsp;</p><p style=\"margin-left:40px;\">les dplacements collectifs &nbsp;et les courses organises ds leur reprise prochaine,&nbsp;</p><p style=\"margin-left:40px;\">la convivialit des moments festifs qui ponctuent l\'anne...,&nbsp;</p><p style=\"margin-left:40px;\">la possibilit aussi de s\'engager dans le bnvolat de la gestion d\'une structure associative.</p><p>Mme si la FFA a dcid de prolonger la validit de la licence 2019-2020 jusqu\'au 31 octobre 2020, les nouvelles licences peuvent ds aujourd\'hui tre valides et rgles sur notre site www.valdesomme.net (suivez les instructions et documents  remettre).&nbsp;</p><p>Ne perdez pas de temps, cela facilitera le travail de notre secrtariat (et la date de fin de validit sera toujours du 31 aot 2021). En consquence de la crise COVID-19, le conseil d\'administration du club a dcid de proposer une licence  prix modique, et des conditions de r adhsion exceptionnelles pour les titulaires d\'une licence 2019-2020 (ouvrez votre espace membres pour procder  votre r-adhsion).&nbsp;</p><p>Pour toute interrogation, les bnvoles du club se tiennent  votre coute (contact@valdesomme.net), et seront prsents <strong>au salon AGORA du 11 septembre  Amiens</strong>.&nbsp;</p><p>Notez dores-et-dj l\'organisation du \"<strong>FFA Run-2k challenge</strong>\" : une opration portes-ouvertes qui permettra d\'valuer son niveau et de rencontrer l\'encadrement sportif du club. Rendez-vous au stade de Camon le <strong>mercredi 16 septembre entre 17h et 20h</strong>.&nbsp;</p><p>Vive la course  pied  l\'amicale du Val de Somme !</p>', 'Dominique Lazure', 1, '2020-08-06 00:00:00'),
(2, 'Courses de la Somme en sursis', '<p>Concernant l\'organisation de plusieurs grandes courses prvues  la rentre dans le dpartement l\'incertitude subsiste et les organisateurs devraient prendre position dbut septembre, en particulier pour le mmorial Willecocq a Abbeville prvu le 4 octobre (10km) les 5km 10km et semi marathon de la Somme prvus le 17 octobre et la finale 2020 des 4 saisons (150eme dition anniversaire) prvue le 08 novembre&nbsp;</p><p>Sont dors et dj annules :&nbsp;</p><p style=\"margin-left:40px;\">les courses des coquelicots  Albert,&nbsp;</p><p style=\"margin-left:40px;\">les urban trail d\'Amiens et Abbeville,</p><p style=\"margin-left:40px;\">Guignemicourt, Hangest, Saint Blimont, la Moldreuilloise, les virades a Camon, la matelote, la Jules Verne,&nbsp;</p><p style=\"margin-left:40px;\">les trails des vidames et des allums.</p>', 'Delasalle Jean Franois', 1, '2020-08-14 00:00:00'),
(3, 'Report de la 150me dition des 4 saisons d\'Amiens-mtropole', '<p><span style=\"color:rgb(0,0,0);\">La course pdestre des 4 saisons dAmiens-Mtropole sest dispute sans discontinuer depuis 1983 pour un total de 149 ditions. Nous tenons  remercier chaleureusement Amiens-Mtropole et nos partenaires pour leur fidle soutien.</span><br><br><span style=\"color:rgb(0,0,0);\">La clbration de la 150me dition, avec un programme enrichi et festif, tait prvue le 7 juin dernier mais la crise sanitaire actuelle a contraint un premier report au 8 novembre 2020.</span><br><br><span style=\"color:rgb(0,0,0);\">Cest avec regret que nous constatons que les conditions sanitaires et de scurit, tant pour les participants que pour les spectateurs et pour lquipe des bnvoles, ne permettent pas encore le tenue de cette 150me dition. Ldition de la finale du 8 novembre est donc annule conformment  la dcision du comit directeur de lAmicale du Val de Somme en date du 26 aot 2020.</span><br><br><span style=\"color:rgb(0,0,0);\">La 150me dition des 4 saisons marquera le redmarrage de ces comptitions qui manquent amrement  nos athltes. Souhaitons quelle intervienne le plus rapidement possible dans le calendrier 2021 : dition hiver du 14 fvrier 2021, printemps du 28 mars 2021, t du 4 juillet 2021 et automne du 7 novembre 2021.&nbsp;</span><br><br><span style=\"color:rgb(0,0,0);\">Lamicale du Val de Somme encourage pour linstant chaque athlte  continuer sa pratique respectueuse des consignes sanitaires et lui donne rendez-vous pour cette 150me dition qui sera dautant plus festive quattendue !</span><br><br>&nbsp;</p>', 'Dominique lazure', 1, '2020-08-26 00:00:00'),
(4, 'Programme d\'entrainement du 24 au 30/08/2020', '<p>Bonjour  tous&nbsp;</p><p style=\"margin-left:40px;\">Lundi/Mardi : Footing de 45 mn.&nbsp;</p><p style=\"margin-left:40px;\">Mercredi : Sance de fractionn au stade de Camon de 17H45  20H00&nbsp;</p><p style=\"margin-left:80px;\">VMA Courte : (200 X 6) X 3 - RA 45 \'\' - RR 2\'30\'\'&nbsp;</p><p style=\"margin-left:40px;\">Vendredi : Sance de ctes&nbsp;</p><p style=\"margin-left:80px;\">Echauffement 20 mn&nbsp;</p><p style=\"margin-left:80px;\">Choisir une cte avec un pourcentage moyen et faire 14 X 150 mtres,&nbsp;</p><p style=\"margin-left:80px;\">Rcupration en descente trs trs lente,&nbsp;</p><p style=\"margin-left:80px;\">Terminer la sance par une rcupration de 15/20 mn&nbsp;</p><p style=\"margin-left:40px;\">Week-end : Sortie longue de 1H30  1H45 en allure fondamentale ( 60/65 % de la VMA)&nbsp;</p><p>Bon courage  tous</p><p>&nbsp;Vos coachs</p>', 'Eric DECLERCQ', 3, '2020-08-26 00:00:00'),
(6, 'Annulations en sries', '<p style=\"margin-left:10px;\">Suite a la pandmie COVID et aux contraintes sanitaires d\'organisation les annulations de courses se succdent chaque jour.</p><p style=\"margin-left:10px;\">En France les championnats de France de cross, de semi marathon et de marathon ont t annules, le marathon et semi marathon de Paris galement ainsi que de trs nombreuses courses. Si vous tes inscrits  une preuve vrifiez bien auprs des organisateurs si elle a lieu et les conditions ventuelles concernant votre inscription en cas de report.</p><p style=\"margin-left:10px;\">Dans la rgion et le dpartement il en est de mme : consultez la mise a jour du calendrier sur Courses80, il volue constamment et il est&nbsp; fort probable qu\'il n y aura que trs peu de courses organises d\'ici la fin de l\'anne.</p><p style=\"margin-left:10px;\">A l\'tranger plusieurs grands marathons internationaux ont t annul galement et envisagent une dition 2021 avec une participation trs restreinte rserve  une lite internationale (150  200 coureurs  Londres par exemple).</p><p style=\"margin-left:10px;\">Vivement un monde meilleur dbarrass de ce foutu virus, mais il faudra tre patient.</p><p style=\"margin-left:10px;\">Plus que jamais protgez vous et vos proches, sortez masqus et vitez les rassemblements</p>', 'Jean Franois Delasalle', 1, '2020-06-15 00:00:00'),
(7, 'Report de la 150me dition des 4 saisons d\'Amiens-mtropole', '<p><span style=\"color:rgb(0,0,0);\">La course pdestre des 4 saisons dAmiens-Mtropole sest dispute sans discontinuer depuis 1983 pour un total de 149 ditions. Nous tenons  remercier chaleureusement Amiens-Mtropole et nos partenaires pour leur fidle soutien.</span><br><br><span style=\"color:rgb(0,0,0);\">La clbration de la 150me dition, avec un programme enrichi et festif, tait prvue le 7 juin dernier mais la crise sanitaire actuelle a contraint un premier report au 8 novembre 2020.</span><br><br><span style=\"color:rgb(0,0,0);\">Cest avec regret que nous constatons que les conditions sanitaires et de scurit, tant pour les participants que pour les spectateurs et pour lquipe des bnvoles, ne permettent pas encore le tenue de cette 150me dition. Ldition de la finale du 8 novembre est donc annule conformment  la dcision du comit directeur de lAmicale du Val de Somme en date du 26 aot 2020.</span><br><br><span style=\"color:rgb(0,0,0);\">La 150me dition des 4 saisons marquera le redmarrage de ces comptitions qui manquent amrement  nos athltes. Souhaitons quelle intervienne le plus rapidement possible dans le calendrier 2021 : dition hiver du 14 fvrier 2021, printemps du 28 mars 2021, t du 4 juillet 2021 et automne du 7 novembre 2021.</span><br><br><span style=\"color:rgb(0,0,0);\">Lamicale du Val de Somme encourage pour linstant chaque athlte  continuer sa pratique respectueuse des consignes sanitaires et lui donne rendez-vous pour cette 150me dition qui sera dautant plus festive quattendue !</span></p>', 'Dominique Lazure', 2, '2020-05-20 00:00:00'),
(8, 'Les 4 saisons : une finale bien arrose', '<p>&nbsp;</p><figure class=\"image image-style-side\"><img src=\"http://valdesomme.net/kcfupload/images/10km_premiere_dame_Mull_Jochem%281%29.jpg\" alt=\"\"></figure><p style=\"margin-left:4px;\">Disputes sous une pluie dense les 3 courses de la finale 2019 des 4 saisons&nbsp;ont nanmoins&nbsp;donn lieu  des performances de grande qualit.<br>482 coureurs se sont classs et sont rentrs chez eux bien tremps en ce dimanche d\'automne un peu maussade. Heureusement la chaleur tait dans les coeurs et les jambes.</p><figure class=\"image\"><img src=\"http://valdesomme.net/kcfupload/images/10km_premier_homme_Dubreucq.jpg\" alt=\"\"></figure><p style=\"margin-left:4px;\"><br>La course phare a t une nouvelle fois remporte par Antoine Dubreucq (VDS) leader de bout en bout devant le champenois Axel Michaut et l\'abbevillois Abdelkarim Abdelmoumane, premier espoir de la course. Chez les dames Mireille Mull Jochem, venue de Saint Germain n\'a pas connu de relle opposition pour l\'emporter en 39.50 devant Aicha Zouaoui (AUC) et Amelia Cuvellier (Le Touquet TN)..<br>A noter que le team Alisa Nowak, Ludovic Dubreucq et Antoine Dubreucq, rcents champions de France par quipes aux 100km il y a 15 jours semblait avoir parfaitement rcupr pour cette course de reprise et fut de nouveau copieusement applaudi.<br>&nbsp;</p><figure class=\"image\"><img src=\"http://valdesomme.net/kcfupload/images/5km_premiere_femme_Gardel_Gwenaelle.jpg\" alt=\"\"></figure><p style=\"margin-left:4px;\">Sur le 5 km une tres belle densite de performances a t enregsitre malgr la forte pluie, avec 15 coureurs sous les 18 minutes et une belle victoire de Kevin Daniel en 16.22 et de Gwenaelle Depaula en 19.30.. Bravo aux 155 courageux coureurs de 5 km qui ont affront la plus forte averse le la matine.</p><figure class=\"image\"><img src=\"http://valdesomme.net/kcfupload/images/5km_premier_homme_Kevin_Daniel.jpg\" alt=\"\"></figure><p style=\"margin-left:4px;\"><br>Grand merci aux 50 bnvoles qui ont tout fait pour faire oublier la mto du jour</p><p style=\"margin-left:4px;\">Les resultats sont en ligne sur ce site (avec les nouvelles catgories des masters par tranches de 5 ans) ainsi que toutes les photos. Merci une nouvelle fois  Jean Pierre, Marie, Sophie et Adilio qui ont brav les intempries pour vous les offrir.&nbsp;</p><p>&nbsp;</p>', 'Jean Franois Delasalle', 2, '2019-11-15 00:00:00'),
(9, 'Les VDS femmes solidaires', '<p style=\"margin-left:10px;\">Bravo aux 21 VDS qui ont brav le vent  la Hotoie lors du rendez vous annuel de la journe de la femme sur 5km</p><p style=\"margin-left:10px;\">Flicitations  Charlyne, Vronique et Maryse pour leurs victoires en catgorie.</p><p style=\"margin-left:10px;\">Logiquement ce sont nos deux plus jeunes reprsentantes Charlyne et Mganne qui se sont montres les plus rapides</p><p style=\"margin-left:10px;\">&nbsp;</p>', 'GUY VERGHOTE', 4, '2020-03-09 00:00:00'),
(10, 'Championnat de France Cross Country', '<figure class=\"image\"><img src=\"http://valdesomme.net/kcfupload/images/85130217_2796324837056697_7089975237340561408_o.jpg\" alt=\"\"></figure><p style=\"margin-left:10px;\">Pierre-Olivier Delattre a termin&nbsp;Vice Champion de France Police de cross-country cette semaine.</p><p style=\"margin-left:10px;\">Et de plus 3me par quipe.</p><p style=\"margin-left:10px;\">Bravo  lui et surtout bonne continuation pour cette anne qui dbute merveilleusement bien.</p><p style=\"margin-left:10px;\">&nbsp;</p>', 'Dominique Lazure', 4, '2020-05-30 00:00:00'),
(12, 'Prconisations d\'organisation des oprations de rentre', '<p style=\"margin-left:10px;\">La FFA vient de diffuser un document rappelant les mesures sanitaires  prendre pour nos oprations de rentre (document joint  ce fil).</p><p style=\"margin-left:10px;\">Merci  tous de respecter les gestes barrire et de pratiquer le sport en toute responsabilit.</p><p style=\"margin-left:10px;\">Dsormais, chaque regroupement du VDS devra faire l\'objet d\'un recensement prcis des participants afin de garder trace des ventuels cas contact. Il en va de la responsabilit de chacun de se plier  cette petite contrainte qui pourrait rendre un grand service  tous en cas d\'apparition d\'un cas parmi nous.</p><p style=\"margin-left:10px;\">En dehors de la pratique sportive proprement dite, le port du masque et l\'utilisation de gel hydro-alcoolique sont de rigueur avant et aprs cette pratique.</p><p style=\"margin-left:10px;\">La sant de chacun est l\'affaire de tous.</p>', 'Dominique lazure', 3, '2020-09-07 00:00:00'),
(13, 'Programme d\'entrainement du 07 au 13/09/2020', '<p style=\"margin-left:10px;\">Bonjour  tous,</p><p style=\"margin-left:10px;\">Pour information, le VDS organise le 23/09/2020, une soire piste  Camon avec le choix d\'effectuer un 1000, un 1500 ou un 3000 m</p><p style=\"margin-left:10px;\">Nous vous invitons vivement  participer et  vous entrainer pour &nbsp;cet venement.&nbsp;</p><p style=\"margin-left:10px;\"><strong>Lundi/mardi :</strong> Footing 45 mn</p><p style=\"margin-left:10px;\"><strong>Mercredi : </strong>Sance de fractionn au stade de Camon de 17H45  20H00</p><p style=\"margin-left:10px;\">Pour cette sance nous vous demandons de bien vous chauffer et de participer aux gammes pour</p><p style=\"margin-left:10px;\">viter toutes blessures.</p><p style=\"margin-left:10px;\">Sance : 4 X 300 avec 4 mn de repos entre chaque fraction</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;4 X 200 avec 3 mn de repos entre chaque fraction</p><p style=\"margin-left:10px;\">Chaque fraction se fait &nbsp;120/130 % de la VMA (si possible)</p><p style=\"margin-left:10px;\">Retour au calme, tirement et gainage .</p><p style=\"margin-left:10px;\"><strong>Vendredi:</strong> Sance spcifique vitesse :&nbsp; Echauffement 20 mn , puis faire&nbsp; 3 X 500  100 % VMA avec 500 m de rcupration&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; trotte entre chaque fraction. Rcuperation 10/15 mn.</p><p style=\"margin-left:10px;\"><strong>Week-end </strong>: SL 1H00/1H15 en endurance fondamentale</p><p style=\"margin-left:10px;\">Bon courage  tous&nbsp;</p><p style=\"margin-left:10px;\">Vos coachs</p>', 'Eric DECLERCQ', 3, '2020-09-06 00:00:00');
INSERT INTO information (id, titre, contenu, auteur, idType, dateCreation) VALUES
(14, 'Mercredi 16 septembre : relevez le dfi !', '<p>&nbsp;</p><figure class=\"image\"><img src=\"data:image/jpeg;base64,\"></figure><p style=\"margin-left:7.5pt;\"><span style=\"color:black;\">Le mercredi 16 septembre 2020, au stade Lucien Jovelin de Camon, l\'Amicale du Val de Somme invite les amateurs de course  pied, qu\'ils soient dbutants, rguliers ou avertis,  venir rencontrer le club, ses membres et son staff pour relever le dfi du RUN2K challenge organis par la fdration franaise d\'athltisme.</span></p><p style=\"margin-left:7.5pt;\"><span style=\"color:black;\">Le dfi consiste  courir 2000m sur la piste. Ce test permettra  chacun de situer son niveau et valuer ainsi son temps potentiel sur les diffrentes distances des comptitions : 5km 10km, semi ou marathon.</span></p><p style=\"margin-left:7.5pt;\"><span style=\"color:black;\">Les inscriptions seront prises sur place et un dpart (limit  10 participants) sera donn chaque quart d\'heure entre 17h et 19h45.</span></p><p style=\"margin-left:7.5pt;\"><span style=\"color:black;\">Chaque participant recevra un souvenir de sa participation et une attestation de sa performance, des lots tirs au sort seront distribus.</span></p><p style=\"margin-left:7.5pt;\"><span style=\"color:black;\">Les mesures COVID seront respectes, merci d\'arriver en tenue et en respectant les gestes barrire.</span></p><p style=\"margin-left:7.5pt;\"><span style=\"color:black;\">Relevez le dfi avec l\'Amicale du Val de Somme !</span></p><p>&nbsp;</p>', 'Bonjour  toutes et  tous,  la commission mdical', 5, '2020-09-01 00:00:00');
INSERT INTO information (id, titre, contenu, auteur, idType, dateCreation) VALUES
(15, 'Un ami nous a quitt', '<p style=\"margin-left:10px;\">Fernand DECAMBRON nous a quitt fin mai  l\'aube de ses 90 ans.</p><p style=\"margin-left:10px;\">Seuls les anciens coureurs connaissait Fernand qui fut licenci au club dans les annes 1980-2000.</p><p style=\"margin-left:10px;\">Originaire de Poulainville, outre une grande discrtion Fernand tait un excellent coureur qui a longtemps dtenu le record V3 (plus de 60 ans) des 4 saisons en 37.29 ralis en 1990.</p><p style=\"margin-left:10px;\">Il a particip 14 fois aux 10km des 4 saisons avec un record personnel  35.42 en V2  plus de 50 ans.</p><p style=\"margin-left:10px;\">4 fois finisher des 100km du Val de Somme il dtenait un record personnel  8h30 ralis en 1984 en V2</p><p style=\"margin-left:10px;\">Son petit fils Antoine a particip 3 fois aux 4 saisons, venant de la rgion parisienne pour battre le record de son grand pre, sous ses yeux,&nbsp;en avril 2016 avec un chrono de 34.11&nbsp;</p><p style=\"margin-left:10px;\">Adieu Fernand , les gnrations passent, la relve est l.</p>', 'Jean Franois Delasalle', 5, '2020-06-14 00:00:00'),
(16, 'Dconfinement : les recommandations FFA', '<p style=\"margin-left:10px;\">Bonjour  toutes et  tous,</p><p style=\"margin-left:10px;\">la commission mdicale de la FFA, prside par le Dr Franois Perla, vient de publier des recommandations pour la stratgie de dconfinement et les activits athltiques. Le document (lien ci-dessous) est scientifiquement tay mais reste nanmoins parfaitement accessible  celles et ceux qui prendront le temps de le parcourir.</p><p style=\"margin-left:10px;\">C\'est sur ces recommandations que le Val de Somme basera ses dcisions  venir sur l\'organisation de ses activits.</p><p style=\"margin-left:10px;\">Pour l\'instant, et probablement jusque fin aot au minimum, la pratique reste solitaire, et le respect de la distanciation physique de 10 mtres reste plus que jamais en vigueur pour le bien de toutes et tous. Continuons  faire preuve de citoyennent.</p><p style=\"margin-left:10px;\">Bonnes sorties solitaires, prenez soin de votre sant.</p>', 'Dominique Lazure', 5, '2020-05-10 00:00:00'),
(17, 'Rsultats du RUN2K challenge du Val de Somme', '<p style=\"margin-left:10px;\">Grand merci  la soixantaine de participants qui sont venus se tester sur 2000m dans le cadre de l\'opration fdrale Run2K challenge.</p><p style=\"margin-left:10px;\">Merci galement  tous d\'avoir respect au mieux les gestes barrires et le port du masque dans ces temps diffciles o trs peu de courses ont lieu..</p><p style=\"margin-left:10px;\">Chacun a pu participer  son niveau sous les encouragements des amis et supporters du club et des clubs voisins (merci au passage au club de l US Camon athltisme d\'avoir accept de nous proposer ses locaux pour le secrtariat)</p><p style=\"margin-left:10px;\">Les rsultats dtaills sont en piece jointe (pour plus de conseils consultez les encadrants du club).</p><p style=\"margin-left:10px;\">Nous vous rappelons galement que le mercredi 23 septembre prochain aura lieu une soire de demi fond sur ce meme stade de Camon  partir de 19 h avec au programme 1000m , 1500m et 3000 m , ces distances peuvent galement servir  mieux lvaluer votre niveau de VMA (surtout le 1500m). Inscriptions sur place (licence FFA obligatoire 2020 ou 2021).</p>', 'GUY VERGHOTE', 5, '2020-09-20 19:45:12'),
(18, 'Rsultats de la soire piste VDS du 23 09 2020 au stade de Camon', '<p style=\"margin-left:10px;\">Malgr la mto trs menaante nous avons chapp de peu  l\'orage pour cette unique soire demi fond de l\'anne 2020 alors qu\'habituellement nous en organisons 3 ou 4 chaque anne &nbsp;depuis 2011 dans les mmes conditions (courses de niveaux, organisation brve avec 2 ou 3 distances seulement proposes).</p><p style=\"margin-left:10px;\">85 coureurs rpartis en 6 courses et reprsentant 12 clubs diffrents ont particip,</p><p style=\"margin-left:10px;\">Parmi les principales performances de la soire on retiendra surtout les 2.39.0 au 1000m du minime de Noyon Ayub Hamid Ali devant son coquipier galement minime Quentin Defer en 2.41.4, les 8.50.0 au 3000m de Jean Jacques Trogneux (AUC), les chronos prometteurs au 1000 m de la cadette Tara Lepinoy (USC) 3.16.2&nbsp;et de la minime Charlyne Poquet (VDS) 3.23.9, ainsi que le 10.52 au 3000m de Saliha Rarbi en masters</p><p style=\"margin-left:10px;\">Merci  tous et rendez vous en mai 2021 sous une belle mto printanire et si le Covid nous le permet.</p><p style=\"margin-left:10px;\">Tous les rsultats en pice jointe</p>', 'GUY VERGHOTE', 3, '2020-09-25 18:47:15'),
(19, 'PROGRAMME D\'ENTRAINEMENT DU 21/09 AU 27/09/20', '<p style=\"margin-left:10px;\">Bonjour  tous et dsol pour le retard</p><p style=\"margin-left:10px;\">Lundi/Mardi : Footing cool de 45 mn avec quelques accelerations de 100/150 m en fin de sance</p><p style=\"margin-left:10px;\">MERCREDI : A ne pas manquer, notre soire piste au stade de Camon, venez nombreux vous tester sur le 1000, le 1500 ou le</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3000 mtres . Premire course  19H00 .&nbsp; On vous attend ds 18H00 pour l\'inscription, l\'chauffement et pourquoi pas une srie&nbsp;</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; gammes avant de vous lancer sur la piste.</p><p style=\"margin-left:10px;\">&nbsp;</p><p style=\"margin-left:10px;\">Vendredi : Petite de sance de ctes : Echauffement 20 mn, puis choisir une cte moyenne et faire 10 X 150 m 95 % de la VMA et finir par une petite&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;rcupration de 10/15 mn.</p><p style=\"margin-left:10px;\">&nbsp;</p><p style=\"margin-left:10px;\">Week-end : SL 1H15  1H30 en allure fondamentale</p><p style=\"margin-left:10px;\">&nbsp;</p><p style=\"margin-left:10px;\">Bon courage  tous</p><p style=\"margin-left:10px;\">Vos coachs</p>', 'Eric Declerc', 3, '2020-09-13 19:03:00'),
(20, 'PROGRAMME D\'ENTRAINEMENT DU 28/09 au 04/10/2020', '<p style=\"margin-left:10px;\">Bonjour  tous</p><p style=\"margin-left:10px;\">Lundi/Mardi : Traditionnel footing 45 mn&nbsp;</p><p style=\"margin-left:10px;\">Mercredi : Sance de fractionn&nbsp;au stade de Camon de 17H45  20H00</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Sance mixte :&nbsp; (/300/400/500/400/300) X2&nbsp; - RA 50\'\' - 55\'\' - 1\'&nbsp; - RR 3\' entre les deux blocs</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Ne pas oublier, l\'chauffement, les gammes, le retour au calme et les tirements.</p><p style=\"margin-left:10px;\">&nbsp;</p><p style=\"margin-left:10px;\">Vendredi :&nbsp; Sance d\'allures : Echauffement 20 mn , puis faire 10 mn VS Semi&nbsp;, puis rcupration active de 2 mn , puis&nbsp; faire 10 mn en VS 10 finir</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; par un retour au calme 15 mn&nbsp;</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p style=\"margin-left:10px;\">Week-end : Footing allure fondamentale 60% de la VMA 1H30&nbsp;&nbsp;&nbsp;</p><p style=\"margin-left:10px;\">Bon courage  tous</p><p style=\"margin-left:10px;\">Vos coachs</p>', 'Eric Declerc', 3, '2020-09-28 17:15:14');
