INSERT INTO `page` (id, nom, contenu) VALUES
(1, 'Prsentation du club', '<p>&nbsp;</p><figure class=\"image\"><img src=\"data:image/gif;base64,\"></figure><p><span class=\"text-big\">LAmicale du Val de Somme&nbsp;<strong>club de course  pied</strong>, cre en 1984, situe  Amiens, est affilie  la Fdration Franaise dAthltisme (FFA).</span></p><p><span class=\"text-big\">L\'Amicale du Val de Somme permet aux coureurs sur route de&nbsp;<strong>tous niveaux</strong>&nbsp;(jogger du dimanche, dbutants, coureurs confirms, ...) de se regrouper au sein d\'une amicale ou chacun vient&nbsp;<strong>courir librement</strong>, sans obligation de participer  des entranements ou des comptitions, afin dentretenir des relations damiti et de bonne camaraderie et de bnficier de conseils.</span></p><p>&nbsp;</p><p><span class=\"text-big\">Toutes les formes de courses sont pratiques&nbsp;<strong>(cross country, route, piste, trail)</strong>&nbsp; toutes les allures, chaque adhrent organise sa saison sportive comme il le dsire sans obligation sportive envers le club.</span></p><p><span class=\"text-big\">L\'Amicale du Val de Somme c\'est galement une&nbsp;<strong>quipe technique</strong>,  votre disposition, prte  vous donner tous les conseils d\'entranement, de prparation, de rcupration lors des 3 entranements et regroupements hebdomadaires, sur les courses ou autres lieux de rencontre.</span></p><p>&nbsp;</p><p><span class=\"text-big\">Le Val de Somme, c\'est aussi une&nbsp;<strong>quipe organisatrice de comptitions dans le dpartement depuis plus de 20 ans</strong>, en particulier  Amiens avec les 10 Kilomtres des 4 Saisons, mais aussi comme&nbsp;<strong>support technique d\'preuves</strong>&nbsp;organises par certains de ses membres( Hangest, Rubempr, Villers Bretonneux, Hallencourt, etc...)</span><br><span class=\"text-big\">Le club prend galement un part active&nbsp;<strong>dans l\'organisation du Marathon et des 100 Kilomtres de la Somme</strong>&nbsp;(Mesurage, Flchage, Inscriptions, Chronomtrage  puces, etc...)</span></p><p>&nbsp;</p>'),
(2, 'Adhsion au club', '<figure class=\"image\"><img src=\"data:image/gif;base64,\"></figure><p><strong>L\'adhsion  l\'Amicale du Val de Somme pour la Saison 2020-2021</strong></p><p><strong>Cotisation Saison 2020-2021</strong></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Montant de l\'adhsion pour la saison 2020-2021 avec une licence Running:&nbsp;<strong>50,00 Euros</strong></td></tr><tr><td>&nbsp;</td><td>Montant de l\'adhsion pour la saison 2019-2020 avec une licence Comptition:&nbsp;<strong>65,00 Euros</strong></td></tr></tbody></table></figure><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Montant du renouvellement d\'adhsion pour la saison 2020-2021 avec une licence Running:&nbsp;<strong>30,00 Euros</strong></td></tr><tr><td>&nbsp;</td><td>Montant du renouvellement d\'adhsion pour la saison 2019-2020 avec une licence Comptition:&nbsp;<strong>45,00 Euros</strong></td></tr></tbody></table></figure><p>&nbsp;</p><p><strong>Licence FFA saison 2020-2021</strong></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>La licence FFA&nbsp;<strong>Running</strong>&nbsp;ou FFA&nbsp;<strong>Comptition</strong>&nbsp;permet de courir partout en France</td></tr><tr><td>&nbsp;</td><td>Seule la licence FFA Comptition autorise la participation et le classement aux championnats rgionaux ou nationaux FFA, route, cross et piste.<br><strong>Attention</strong>: Aucun changement de type de licence ne sera possible aprs l\'enregistrement informatique effectu</td></tr><tr><td>&nbsp;</td><td>Une fois le formulaire d\'adhsion en ligne saisi, et le certificat mdical envoy par mail, les premires licences 2019-2020 seront saisies et les membres recevront&nbsp;<strong>directement de la FFA par Mail</strong>&nbsp;un fichier joint comportant la nouvelle licence elle-mme,  garder et imprimer pour les justificatifs rclams lors des inscriptions aux courses.<br><strong>Aucun courrier postal ne sera adress</strong>&nbsp;concernant la licence FFA. Il est donc important&nbsp;<strong>de communiquer correctement et lisiblement</strong>&nbsp;votre dernire adresse Email.<br>La licence 2019-2020&nbsp;<strong>expirera totalement au 31 Octobre 2020</strong>&nbsp;et ne sera plus valable pour les inscriptions aux courses ni pour l\'assurance,  partir du 1 novembre 2020.</td></tr></tbody></table></figure><p><strong>Mutation</strong></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Renseignements en crivant  l\'adresse mail contact@valdesomme.net</td></tr><tr><td>&nbsp;</td><td>Une mutation sportive FFA est obligatoire si lors de la saison sportive prcdente vous tiez dans un autre club FFA</td></tr></tbody></table></figure><p>&nbsp;</p><p><strong>Assurance</strong></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Le club a opt pour l\'assurance responsabilit civile propose par la&nbsp;<strong>FFA</strong></td></tr><tr><td>&nbsp;</td><td>Vous tes assurs par votre licence FFA dans le cadre des&nbsp;<strong>comptitions</strong>&nbsp;et des&nbsp;<strong>entranements du club</strong></td></tr><tr><td>&nbsp;</td><td>Le licenci peut souscrire un contrat d\'assurance individuel couvrant les dommages corporels auxquels sa pratique sportive peut l\'exposer, mais elle n\'est pas obligatoire. Le licenci recevra directement  son domicile en mme temps que sa licence, un bulletion d\'adhsion aux options complmentaires,  adresser&nbsp;<strong>directement  l\'assurance de la FFA</strong>&nbsp;pour toute souscription supplmentaire souhaite.</td></tr></tbody></table></figure><p><strong>Autres avantages</strong></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Le calendrier des courses pdestres, sera distribu lors des entranements du club et les courses courant Janvier.</td></tr><tr><td>&nbsp;</td><td>Des infos sur les divers vnements ou rductions offertes par le Val de Somme seront disponibles sur le site du club.</td></tr><tr><td>&nbsp;</td><td>La participation aux diffrents challenges de courses pdestres (dpartementaux, rgionaux, nationaux) est automatique pour tous les licencis du club</td></tr><tr><td>&nbsp;</td><td>Transport en car gratuit lors du ou des dplacements officiels du club sur des courses (ex 10Km et semi marathon de Saint Denis en 2019)</td></tr><tr><td>&nbsp;</td><td>Inscription gratuite sur le site du club aux 5Km et 10 Km des 4 Saisons d\'Amiens Mtropole</td></tr></tbody></table></figure><p>&nbsp;</p><p><strong>Le club</strong></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>L\'Amicale du Val de Somme est un club affili  la Fdration Franaise d\'Athltisme.</td></tr><tr><td>&nbsp;</td><td>L\'Amicale du Val de Somme permet aux coureurs sur route de tous niveaux (coureurs dbutants, loisirs, comptitions) de se regrouper au sein d\'une amicale ou chacun vient courir librement, sans aucune obligation de participer  des entranements ou comptitions, afin d\'entretenir des relations d\'amiti et de bonne camaraderie.</td></tr><tr><td>&nbsp;</td><td>Toutes les formes de courses sont pratiques (route, cross country, piste, trail, kec),  tous les niveaux</td></tr></tbody></table></figure><p>&nbsp;</p><p><strong>Les entranements</strong></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Un entranement convivial adapt  votre niveau</td></tr></tbody></table></figure><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Mardi</td><td>18H00</td><td>Amiens la Hotoie, alle du zoo</td><td>&nbsp;</td></tr><tr><td>&nbsp;</td><td>Mercredi</td><td>18H00</td><td>Stade municipal de Camon</td><td>&nbsp;</td></tr><tr><td>&nbsp;</td><td>Jeudi</td><td>18H00</td><td>Amiens la Hotoie, alle du zoo</td><td>&nbsp;</td></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>'),
(3, 'Bureau du club', '<p>&nbsp;</p><figure class=\"image\"><img src=\"data:image/gif;base64,\"></figure><p>&nbsp;</p><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Prsident</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Dominique LAZURE</span><br><span style=\"color:black;\">Email:&nbsp;</span><a href=\"mailto:lazure@free.fr\"><span style=\"color:windowtext;\">lazure@free.fr</span></a></p></td></tr><tr><td colspan=\"2\">&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Secrtaire</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Dominique DAMIENS</span><br><span style=\"color:black;\">Email:&nbsp;</span><a href=\"mailto:contact@valdesomme.net\"><span style=\"color:windowtext;\">contact@valdesomme.net</span></a></p></td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Secrtaire Adjoint</span></p></td><td><p style=\"margin-left:0cm;\">&nbsp;</p></td></tr><tr><td colspan=\"2\">&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Trsorier</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Ludovic TISON</span></p></td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Trsorier adjoint</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Guy VERGHOTE</span></p></td></tr><tr><td colspan=\"2\">&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">1re Vice-Prsidente</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Batrice CARANTON</span></p></td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">2me Vice-Prsident</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Yannick LEFEVRE</span></p></td></tr><tr><td colspan=\"2\">&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Membres</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Thierry ACOULON</span><br><span style=\"color:black;\">Thierry BELLEMERE</span><br><span style=\"color:black;\">Vincent BIVILLE</span><br><span style=\"color:black;\">Eric DECLERCQ</span><br><span style=\"color:black;\">Floryse DELASALLE</span><br><span style=\"color:black;\">Jean Franois DELASALLE</span><br><span style=\"color:black;\">Cline DEPUILLE</span><br><span style=\"color:black;\">Gael DUPONT</span><br><span style=\"color:black;\">Patrice LEBEAU</span><br><span style=\"color:black;\">Claude SIMIONI</span><br><span style=\"color:black;\">Christian WYCKAERT</span></p></td></tr></tbody></table></figure>'),
(4, 'Entrainements', '<figure class=\"image\"><img src=\"data:image/gif;base64,\"></figure><p><span style=\"color:#00469C;\"><strong>Avec qui ?</strong></span></p><figure class=\"table\"><table><tbody><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Les entraneurs</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Patrice LEBEAU adresse mail: patricelebeau@free.fr</span><br><span style=\"color:black;\">Eric DECLERCQ adresse mail: declercqdedisse@orange.fr</span></p></td></tr></tbody></table></figure><p><span style=\"color:#00469C;\"><strong>Ou et quand ?</strong></span></p><figure class=\"table\"><table><tbody><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">La Hotoie</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Regroupements prs de l\'entre de l\'alle du zoo</span><br><span style=\"color:black;\">le mardi de 18H00  19H30</span><br><span style=\"color:black;\">le jeudi de 18H00  19H30</span></p></td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Stade muncipal de Camon</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Entrainements sur la piste et chemin de halage</span><br><span style=\"color:black;\">le mercredi de 17H45  20H00</span><br><span style=\"color:black;\">rendez vous  partir de 17h45 pour chauffement individuel ou collectif, dbut des gammes  18h20 prcises, dbut de la sance piste  18h30 prcises</span></p></td></tr></tbody></table></figure>'),
(5, 'Courses en vue', '<p>&nbsp;</p><figure class=\"image\"><img src=\"data:image/gif;base64,\"></figure><p>Cette rubrique a pour but de vous signaler les courses hors dpartement pour lesquelles certains de nos membres envisagent une participation. Ces sorties ne sont pas celles planifies par le club. Attention de ne pas pnaliser les courses organises par l\'amicale et les grands rendez-vous du dpartement. Si vous voulez voir vos projets de course dans cette rubrique, merci de contacter Vincent Biville  l\'adresse vincentbiville@sfr.fr</p><p><strong>Anne 2020s</strong></p><p><strong>26 janvier: Marrakech (Maroc)&nbsp;</strong>&gt; Marathon-semi&nbsp;<strong>:&nbsp;</strong>Laetitia Melchior, Sarah Lamy, Isabelle Moreira, Jos Ledreux, J-P Joly</p><p><strong>26 janvier: Touquet Paris-Plage :&nbsp;Trail D2B &gt;&nbsp;</strong>42 km :Marie-Christine Suel</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <strong>&gt;&nbsp;</strong>24 km:<strong>&nbsp;</strong>Marie Urbaniak, Fanny Leclerc, Gal Dupont, David Fronval</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <strong>&gt;&nbsp;</strong>11 km :<strong>&nbsp;</strong>Lucie Bara</p><p><strong>9 fvrier : Mesnires en Bray :&nbsp;Trail Fort et Vert&nbsp;</strong>&gt; 34 km :<strong>&nbsp;</strong>Marie-Christine Suel, Christophe Alfred&nbsp;&nbsp;&nbsp;&nbsp; &gt; 27 km: Odile Fatier, Vincent Biville &gt;19 km : Claude Simioni, Lucille Leclercq, Batrice Nourry, Marie-Sylvette Par, Laurent Par</p><p><strong>1er Mars:&nbsp; 4 saisons d\'Hiver</strong></p><p><strong>1er Mars : Auvergne :&nbsp;Trail du Vulcain</strong>&nbsp;&gt; 47 km: Marie-Christine Suel&nbsp; &gt; 20 km: Marie-Sylvette Par, Laurent Par</p><p><strong>29 Mars: &nbsp;Alenon Mdavy</strong>: Didier Kaeser</p><p>--------------------------------------------------------------------------------------------------------------------------------------------</p><p>CRISE SANITAIRE COVID 19</p><p><strong>29 Mars:&nbsp;Semi marathon de Salouel ANNULE</strong></p><p><strong>5 Avril: Paris &gt; Marathon:</strong>&nbsp;Marie-Christine Sue ANNULEl</p><p><strong>5 Avril : Valenciennes&nbsp;</strong>&gt; 10 km:&nbsp;Frdric Delangue ANNULE</p><p><strong>12 Avril: Cassel: l\'Alternative Watten-Cassel &gt; Semi-marathon:&nbsp;</strong>David Fronval ANNULE</p><p><strong>19 Avril : Bailleul : Nord Trail Monts de Flandres</strong>&nbsp;&gt; 59 km :<strong>&nbsp;</strong>Marie-Christine Suel ANNULE</p><p><strong>25 Avril:&nbsp;Belves &gt; championnats de France des 100 km:&nbsp;</strong>Vincent Biville ANNULE</p><p><strong>1er Mai: Maroilles&nbsp;</strong>&gt; 20 km: Vincent Hoornaert,&nbsp;ANNULE</p><p><strong>10 Mai: Saumur &gt;&nbsp;</strong>semi-marathon, marathon<strong>:</strong>&nbsp;Odile Fatier, Claude Simioni, Marie Urbaniak, Gael Dupont, Myriam Biville, Vincent Biville, Jenifer Ruis, Valero Angelito, Celine Depuille, David Regnard, Teddy Barbosa Da Silva, David Fronval, Christophe Alfred,&nbsp; ANNULE</p><p><strong>10 Mai: Lille-Lens: Marathon de la route du Louvre:&nbsp;</strong>Batrice Caranton, Bernard Caranton, Thierry Bellemere&nbsp; ANNULE</p><p><strong>8 mai au 17 mai</strong>:&nbsp;<strong>Trail de la muraille de Chine&nbsp;</strong>&gt; 100 km en 7 tapes (25 000 marches / 4000 m de D+): Sarah Lamy, Frdric Vue, J-P Joly, Jos Ledreux ANNULE</p><p><strong>24 Mai: Poitiers &gt; Marathon:</strong>&nbsp;Bruno Druez ANNULE</p><p><strong>31 Mai:&nbsp;Courir la Jules Verne REPORTE AU &nbsp; 11 OCTOBRE puis ANNULE</strong></p><p><strong>7 Juin:&nbsp;La 150eme des 4 Saisons REPORTE AU 8 NOVEMBRE (finale)</strong></p><p><strong>21 Juin: Molsheim&nbsp;</strong>&gt;&nbsp;Marathon, Semi-marathon et 10 km des<strong>&nbsp;Vignobles d\'Alsace</strong>:&nbsp;(sortie organise par Jean BENOIT) ANNULE</p><p><strong>25,26,27,28 juin : Vannes &gt;Raid Golfe du Morbihan&nbsp;</strong>&gt; Grand Raid 177 km :&nbsp;Odile Fatier, Lucile Leclerc&nbsp;&nbsp;&gt; Raid 87 km:&nbsp;Batrice Nourry&nbsp;&gt; Ronde des Douaniers 35 km:&nbsp;&nbsp;Claude Simioni&nbsp;&nbsp;&nbsp; ANNULE</p><p><strong>5 Juillet:&nbsp;4 Saisons d\'t&nbsp;&nbsp; ANNULE</strong></p><p><strong>15 Aot :Auzat &gt; Marathon du Moncalm (2750m D+):&nbsp;</strong>Vincent Biville&nbsp;&nbsp; ANNULE</p><p><strong>13 Septembre :&nbsp;Sortie du club&nbsp;:&nbsp;Rouen&nbsp;&gt; 5 km, 10 km, semi-marathon, marathon&nbsp;&nbsp; ANNULE</strong></p><p><strong>19 Septembre:&nbsp;Les 3 mares de Guignemicourt&nbsp;&nbsp; ANNULE</strong></p>'),
(6, 'Les officiels', '<figure class=\"image\"><img src=\"data:image/gif;base64,\"></figure><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><p style=\"margin-left:0cm;\"><span class=\"text-big\" style=\"color:#00469C;\">Officiels Fdraux</span></p></td><td><p style=\"margin-left:0cm;\"><span class=\"text-big\" style=\"color:black;\">Jean Franois Delasalle</span><br><span class=\"text-big\" style=\"color:black;\">Grard Rimbaut</span><br><span class=\"text-big\" style=\"color:black;\">Dominique Lazure</span></p></td></tr><tr><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span class=\"text-big\" style=\"color:#00469C;\">Officiels Rgionaux</span></p></td><td><p style=\"margin-left:0cm;\"><span class=\"text-big\" style=\"color:black;\">Didier Kaeser</span><br><span class=\"text-big\" style=\"color:black;\">Patrice Lebeau</span><br><span class=\"text-big\" style=\"color:black;\">Sandrine Randon</span><br><span class=\"text-big\" style=\"color:black;\">Laurence Faucheux</span><br><span class=\"text-big\" style=\"color:black;\">Guy Verghote</span></p></td></tr><tr><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span class=\"text-big\" style=\"color:#00469C;\">Officiels Dpartementaux</span></p></td><td><p style=\"margin-left:0cm;\"><span class=\"text-big\" style=\"color:black;\">Floryse Delasalle</span></p></td></tr></tbody></table></figure>');
