(7, 'Prsentation 4 saisons', '<figure class=\"image image-style-align-right\"><img src=\"data:image/gif;base64,\"></figure><figure class=\"image\"><img src=\"data:image/gif;base64,\"></figure><p><strong>Les courses des 4 saisons  Amiens prs du Val de Somme (4 fois par an):</strong></p><p>&nbsp;</p><p><i><strong>Calendrier saison 2020-2021</strong></i></p><figure class=\"table\"><table><tbody><tr><td><strong>14/02/2021</strong>&nbsp;Courses des 4 Saisons d\'Hiver <strong>La 150me course des 4 Saisons</strong></td></tr><tr><td><strong>28/03/2021</strong>&nbsp;Courses des 4 Saisons de printemps</td></tr><tr><td><strong>04/07/2021</strong>&nbsp;Courses des 4 Saisons d\'t</td></tr><tr><td><strong>08/11/2021</strong>&nbsp;Courses des 4 Saisons Finale d\'Automne</td></tr></tbody></table></figure><p><i><strong>Horaires et distances des courses</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td><strong>09h20</strong></td><td>5 Km dcouverte</td><td>Epreuve ouverte  partir de la catgorie Minimes, coureurs licencis ou non licencis.</td></tr><tr><td>&nbsp;</td><td><strong>10h05</strong></td><td>10 Km des joggers</td><td>joggers du dimanche,dbutants ou confirms en&nbsp;45minutes et plus&nbsp;(chronomtrage  partir de 44 minutes pour les hommes, le temps rel sera pris en compte pour les fminines). Epreuve ouverte  partir de la catgorie Cadets, coureurs licencis ou non licencis.</td></tr><tr><td>&nbsp;</td><td><strong>11h20</strong></td><td>10 Km des as</td><td>Coureurs en moins de 45 minutes. Tous les temps (mme suprieurs  45\'00) sont pris en compte. Epreuve ouverte  partir de la catgorie Cadets, coureurs licencis ou non licencis.</td></tr></tbody></table></figure><p><i><strong>Les 3 courses de 5 et 10 km sont inscrites au challenge dpartemental de la Somme.</strong></i></p><p><i><strong>Classements</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Le classement gnral de l\'preuve des 10 Kilomtres des 4 saisons est tabli  partir de l\'ensemble des temps raliss sur les 2 preuves distinctes (10 Km des Joggers et 10 Km des As).<br>Si un coureur participe aux 2 preuves de 10 Km, son meilleur temps est retenu.<br><strong>Pour les hommes, les temps raliss sur l\'preuve des 10 Kilomtres des Joggers infrieurs  44 minutes sont ramens  44 minutes</strong>. Cette clause ne s\'applique pas pour les fminines.</td></tr></tbody></table></figure><p><i><strong>Inscriptions aux courses</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Les inscriptions sont possibles&nbsp;<strong>uniquement en ligne</strong>&nbsp;sur le site du Val de Somme</td></tr><tr><td>&nbsp;</td><td><strong>Le formulaire d\'inscription uniquement en ligne est disponible environ un mois avant la course</strong><br>Toutes les informations de tarifs, dates limites d\'inscription, etc... figurent sur le site  l\'ouverture des inscriptions</td></tr><tr><td>&nbsp;</td><td><strong>Aucune inscription sur place.</strong><br><strong>Plus d\'inscription courrier</strong></td></tr></tbody></table></figure><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>L\' inscription  plusieurs preuves (5Km et 10 Km) est possible sur le mme formulaire d\'inscription. Le cot est identique que vous participiez  une, deux ou trois preuves. Vous ne vous acquittez du montant de l\'engagement qu\'une fois, quelque soit le nombre d\'preuves courues<br>Si vous dcidez, aprs vous tre inscrit, de changer de course, ou d\'en courir une de plus ou de moins, inutile de nous prvenir, notre systme de chronomtrage par puces enregistrera toutes vos participations<br>Vous pouvez galement, le jour de la course, changer d\'preuve, ou en courir une de plus ou de moins. Toutes les preuves courues se font avec le mme dossard et la mme puce de chronomtrie.<br><strong>Dans tous les cas, ne rendez votre puce qu\'aprs avoir particip  votre dernire course</strong></td></tr></tbody></table></figure><p><i><strong>Licences ou Certificats Mdicaux</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td><strong>Attention:</strong>&nbsp;Seules les licences de la Fdration Franaise d\'Athltisme, et de la Fdration UFOLEP Athltisme ou courses sur route sont admises pour les inscriptions sur les courses hors stade.</td></tr><tr><td>&nbsp;</td><td>Pour tous les autres,&nbsp;sans exception, il sera ncessaire de fournir un certificat mdical dat de moins d\'un an au jour de l\'preuve (ou copie)&nbsp;de non contre indication la pratique de la course  pied en comptition&nbsp;ou&nbsp;de non contre indication la pratique de l\'athltisme en comptition. Ce document sera gard obligatoirement pendant un an par l\'organisateur.</td></tr><tr><td>&nbsp;</td><td>Un modle de certificat mdical est disponible en cliquant ici (*)</td></tr></tbody></table></figure><p><i><strong>Retrait des dossards</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Le matin, avant le dpart des courses, ouverture du secrtariat  8H30</td></tr><tr><td>&nbsp;</td><td>Si la colonne Lic/Cm apparat en&nbsp;<strong>vert</strong>&nbsp;dans la liste des inscrits, vous devrez justifier de votre identit (licence, carte d\'identit, ...) pour retirer votre dossard</td></tr><tr><td>&nbsp;</td><td>Si la colonne Lic/Cm apparat en&nbsp;<strong>rouge</strong>&nbsp;(licence ou certificat mdical non prsent),&nbsp;<strong>bleu</strong>&nbsp;(licence saison prcdente), ou&nbsp;<strong>ocre</strong>&nbsp;(certificat mdical non valide) dans la liste des inscrits, vous devrez prsenter votre licence valide ou un certificat mdical conforme pour retirer votre dossard. En cas de prsentation de certificat mdical (ou copie), ce document est gard par l\'organisation.</td></tr></tbody></table></figure><p><i><strong>Autorisation parentale</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Tous les comptiteurs mineurs doivent prsenter un autorisation parentale signe</td></tr><tr><td>&nbsp;</td><td>Un modle d\'autorisation parentale est disponible en cliquant ici (*)</td></tr></tbody></table></figure><p><i><strong>Parcours</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Le dpart des preuves se situe en contrebas du parc sur le chemin de halage prs de l\'cluse<br>Le secrtariat dossard, ainsi que les arrives des courses se situent sous la halle.</td></tr><tr><td>&nbsp;</td><td>Cliquez ici pour voir ou tlcharger la carte du parcours de l\'preuve de 5 Kilomtres</td></tr><tr><td>&nbsp;</td><td>Cliquez ici pour voir ou tlcharger la carte du parcours de l\'preuve de 10 Kilomtres</td></tr></tbody></table></figure><p><i><strong>Venir</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Pour se rendre sur le lieu de la course,  partir de l\'hopital Nord, prendre la rue de Vignacourt (sens descente), tourner  droite au premier feu (rue St Maurice), et continuer tout droit jusqu\'au Parc.</td></tr><tr><td>&nbsp;</td><td>Depuis Amiens par la rocade Nord direction Abbeville, ou depuis Abbeville par la RN1, prendre la sortie 40 direction Longpr les Amiens, suivre la direction Parc de Loisirs - Camping Parc des Cygnes</td></tr></tbody></table></figure>'),
(8, 'Mensions lgales', '<p><i><strong>Mention de droits rservs</strong></i></p><p style=\"margin-left:auto;\">&nbsp;</p><p style=\"margin-left:auto;\">Conformment  la mise place du RGPD en vigeur le 24 mai 2018, les informations vous concernant sont destines  Esprit Run, responsable du traitement. Vous disposez dun droit daccs, de rectification et de suppression des donnes qui vous concernent. Vous pouvez exercer ce droit en adressant un e-mail  ladresse lectronique suivante :&nbsp;<span style=\"color:rgb(124,179,66);\">espritrun80@gmail.com</span></p><p style=\"margin-left:auto;\">Les informations fournies seront exploites de manire anonyme et non nominatives  des fins danalyse et de statistique.</p><p style=\"margin-left:auto;\">En vous connectant  ce site dit et mis en ligne par Esprit Run, vous accdez  un contenu protg par la loi, notamment par les dispositions du Code de la proprit intellectuelle.</p><p style=\"margin-left:auto;\">Les marques de lditeur du site ESPRIT RUN et de ses partenaires, ainsi que les logos figurant sur le site sont des marques dposes. Le tlchargement de tout ou partie des textes, images, sons, photographies, donnes, marques et tout autre lment contenu est autoris  des fins strictement prives, dans le cadre scolaire ou pour un usage non commercial.</p><p style=\"margin-left:auto;\">ESPRIT RUN nautorise quun usage strictement personnel des donnes, informations ou contenus auxquels vous accdez, limit  un enregistrement temporaire sur votre ordinateur aux fins daffichage sur un seul cran ainsi que la reproduction, en un unique exemplaire, pour copie de sauvegarde ou impression sur papier.</p><p style=\"margin-left:auto;\">Toute autre utilisation est soumise  notre autorisation expresse pralable. En poursuivant votre visite de notre site vous acceptez de respecter les restrictions ci-dessus.</p><p style=\"margin-left:auto;\">Le contenu gnr par des tiers (utilisateurs, partenaires) est sous leur entire responsabilit.</p><p style=\"margin-left:auto;\">ESPRIT RUNse rserve le droit de modifier,  tout moment et sans pravis, le contenu de ce site. En outre, ESPRIT RUN dcline toute responsabilit en cas de retard, derreur ou domission quant au contenu des prsentes pages de mme quen cas dinterruption ou de non-disponibilit du service.</p><p style=\"margin-left:auto;\">La cration de liens hypertextes vers le site de ESPRIT RUN ainsi que les liens hypertextes tablis en direction dautres sites  partir du site de ESPRIT RUN nengagent pas la responsabilit de ESPRIT RUN</p><p style=\"margin-left:auto;\">Droits de reproduction et de diffusion rservs </p><p>&nbsp;</p><p><i><strong>Conditions Gnrales dUtilisation</strong></i></p><p style=\"margin-left:auto;\">&nbsp;</p><p style=\"margin-left:auto;\">Les conditions gnrales dutilisation du site HelloAsso sont disponibles  ces adresses</p><p style=\"margin-left:auto;\"><i><strong>Mentions lgales</strong></i></p><p style=\"margin-left:auto;\">&nbsp;</p><p style=\"margin-left:auto;\">ESPRIR RUN<br>Sige social :&nbsp;<span style=\"color:rgb(0,0,0);\">12 RUE FREDERIC PETIT 80000 AMIENS</span></p><p style=\"margin-left:auto;\">Association enregistre sous le numro&nbsp; <span style=\"color:rgb(35,42,52);\">51266640500034</span></p><p style=\"margin-left:auto;\">Reprsentant Lgal : Mr Guillaume Brianchon Prsident su club</p><p style=\"margin-left:auto;\">Hbergeur :<br>OVH<br>SAS au capital de 10 069 020 <br>RCS Lille Mtropole 424 761 419 00045<br>Code APE 2620Z<br>N TVA : FR 22 424 761 419<br>Sige social : 2 rue Kellermann  59100 Roubaix  France</p><p>&nbsp;</p>'),
(9, 'Politique de confidentialit', '<p><span style=\"color:rgb(51,51,51);\"><i><strong>charte relative relative  la protection des donnes  caractre personnel des utilisateurs</strong></i></span></p><p>&nbsp;</p><p><i><strong>1  Dfinition et nature des donnes  caractre personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Lors de votre utilisation du site internet accessible  ladresse&nbsp; <a href=\"http://www.esprtirun.fr/\">www.esprtirun.fr</a> ou sur une <i>Plateforme</i>, qui nous permet de grer les adhsions, nous pouvons tre amens  vous demander de nous communiquer des donnes  caractre personnel vous concernant, dsignant toutes les donnes qui permettent didentifier un individu directement ou indirectement.</p><p style=\"margin-left:0px;\">Dans ce cadre, nous collectons les donnes suivantes :</p><hr><p><i><strong>1.1  Information que vous nous communiquez</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Pour la bonne excution des services que nous proposons dans le cadre de nos activits sportives, et notamment les services de paiement, nous collectons les donnes suivantes :</p><p><strong>Pour les contributeurs :</strong></p><p>&nbsp;</p><ul><li><strong>informations permettant votre identification</strong>&nbsp;lors de louverture de votre compte ou de la ralisation dun paiement : nom, prnom, adresse e-mail, adresse postale, nationalit, date de naissance ;</li><li><strong>toutes informations strictement rserves  la bonne excution de nos activits (taille de maillot, taille pour les batons, )</strong></li></ul><hr><p><i><strong>1.2  Information que nous collectons automatiquement lors de votre utilisation du site</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Lors de votre utilisation du site pour la bonne excution des services, nous sommes galement susceptibles de collecter des donnes  caractre personnel vous concernant, de manire automatique par lintermdiaire des outils et services proposs sur le site</p><p><i><strong>2  Objet de la prsente charte</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">La prsente charte a pour objet de vous informer sur les moyens que nous mettons en uvre pour collecter et traiter vos donnes  caractre personnel, dans le respect le plus strict de vos droits.</p><p style=\"margin-left:0px;\">Nous vous indiquons  ce sujet que nous nous conformons, dans la collecte et la gestion de vos donnes  caractre personnel,  la loi n 78-17 du 6 janvier 1978 relative  linformatique, aux fichiers et aux liberts, dans sa version actuelle, ainsi quau Rglement gnral de protection des donnes (ci-aprs <i>RGPD</i>).</p><p><i><strong>3  Identit du responsable de la collecte et du traitement de donnes</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Le responsable de la collecte et du traitement de vos donnes  caractre personnel est lassociation ESPRIT RUN, association sportive <span style=\"color:rgb(0,0,0);\">ESPRIT RUN, 12 RUE FREDERIC PETIT 80000 AMIENS enregistr sous le numros</span> SIRET <span style=\"color:rgb(35,42,52);\">51266640500034</span></p><p><i><strong>4  Collecte et traitement des donnes  caractre personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Vos donnes  caractre personnel sont collectes et traites pour rpondre  une ou plusieurs des finalits suivantes :</p><ul><li>Grer votre accs sur le site et aux services accessibles et leur utilisation, ainsi que rpondre  toute demande concernant votre utilisation des services,</li><li>Effectuer les oprations relatives  la gestion et au suivi de nos relations avec les utilisateurs, Organisme FFA</li><li>Constituer un fichier de membres inscrits</li><li>Adresser des newsletters ou tous messages informatifs relatifs  notre actualit. Dans le cas o vous ne le souhaiteriez pas, nous vous donnons la facult dexprimer votre refus  ce sujet lors de la collecte de vos donnes ;</li><li>Respecter nos obligations lgales et rglementaires, notamment en matire de lutte contre la fraude bancaire. A ce titre, nous avons notamment lobligation de vrifier ou dauthentifier vos informations collectes lors des oprations de paiement.</li></ul><p style=\"margin-left:0px;\">Nous vous informons, lors de la collecte de vos donnes personnelles, si certaines donnes doivent tre obligatoirement renseignes ou si elles sont facultatives. Nous vous indiquons galement quelles sont les consquences ventuelles dun dfaut de rponse.</p><p><i><strong>5  Destinataires des donnes collectes et traites</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Les membres du bureau, la FFA (pour lenregistrement officielle des licences) auront accs  vos donnes  caractre personnel.</p><p style=\"margin-left:0px;\">La FFA pourra les utiliser pour les mmes finalits et sous les mmes conditions que celles vises dans la prsente Charte. Il reste toutefois seul et uniquement responsable du respect de ses obligations lgales et dclaratives dans le cadre du traitement de vos donnes  caractre personnel quil effectue par lui-mme, avec ses propres moyens et pour ses seuls besoins. Nous ne sommes responsables que de notre utilisation de vos donnes  caractre personnel,  lexclusion de toutes autres utilisations effectues par lOrganisme.</p><p style=\"margin-left:0px;\">Peuvent galement tre destinataires de vos donnes  caractre personnel les organismes publics, exclusivement pour rpondre  nos obligations lgales, les auxiliaires de justice, les officiers ministriels et les organismes chargs deffectuer le recouvrement de crances.</p><p><i><strong>6  Cession des donnes  caractre personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Vos donnes  caractre personnel ne feront pas lobjet de cessions, locations ou changes au bnfice de tiers.</p><p style=\"margin-left:0px;\">Cependant, vous tes informs que nous nous rservons la possibilit de communiquer  des tiers vos donnes entirement anonymises et sous forme agrge, cest--dire dans une forme ne permettant pas de vous identifier, de quelque manire que ce soit.</p><p><i><strong>7  Dure de conservation des donnes  caractre personnel</strong></i></p><p>&nbsp;</p><p><strong>Concernant les donnes relatives  la gestion et au suivi des relations avec les utilisateurs de nos services :</strong></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Vos donnes  caractre personnel ne seront pas conserves au-del de la dure strictement ncessaire  la gestion de notre relation avec vous. Toutefois, les donnes permettant dtablir la preuve dun droit ou dun contrat, devant tre conserves au titre du respect dune obligation lgale, le seront pendant la dure prvue par la loi en vigueur.</p><p style=\"margin-left:0px;\">Nous conservons vos donnes pendant un dlai maximum de trois (3) ans  compter de la collecte de vos donnes ou du dernier contact manant de lutilisateur ou de la fermeture de votre compte.</p><p><strong>Concernant la gestion des listes dopposition  recevoir de la prospection :</strong></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Les informations permettant de prendre en compte votre droit dopposition sont conserves au minimum trois (3) ans  compter de lexercice du droit dopposition.</p><p><strong>Concernant les statistiques de mesure daudience :</strong></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Les informations stockes dans le terminal des utilisateurs ou tout autre lment utilis pour identifier les utilisateurs et permettant leur traabilit ou frquentation ne seront pas conserves au-del de treize (13) mois.</p><p><strong>Concernant larchivage des donnes relatives aux oprations bancaires :</strong></p><p>&nbsp;</p><p style=\"margin-left:0px;\">A lissue de la dure de conservation de vos donnes telle que prcise ci-dessus, nous vous informons que nous archivons vos donnes pendant un dlai de deux (2) ans pour rpondre  nos obligations lgales, notamment en termes de lutte contre la fraude bancaire et le blanchiment dargent.</p><p><i><strong>8  Scurit</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Nous vous informons prendre toutes prcautions utiles, mesures organisationnelles et techniques appropries pour prserver la scurit, lintgrit et la confidentialit de vos donnes  caractre personnel et notamment, empcher quelles soient dformes, endommages ou que des tiers non autoriss y aient accs.</p><p><i><strong>9  Hbergement</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Nous vous informons que vos donnes sont conserves et stockes, pendant toute la dure de leur conservation</p><p style=\"margin-left:0px;\">Vos donnes ne feront lobjet daucun transfert en dehors de lUnion europenne dans le cadre de lutilisation des services que nous vous proposons.</p><p><i><strong>10  Cookies</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Les cookies sont des fichiers textes, souvent crypts, stocks dans votre navigateur. Ils sont crs lorsque le navigateur dun utilisateur charge un site internet donn : le site envoie des informations au navigateur, qui cre alors un fichier texte. Chaque fois que lutilisateur revient sur le mme site, le navigateur rcupre ce fichier et lenvoie au serveur du site internet.</p><p style=\"margin-left:0px;\">On peut distinguer trois types de cookies, qui nont pas les mmes finalits : les cookies techniques, les cookies des rseaux sociaux et les cookies publicitaires :</p><ul><li>Les cookies techniques sont utiliss tout au long de votre navigation, afin de la faciliter et dexcuter certaines fonctions. Un cookie technique peut par exemple tre utilis pour mmoriser les rponses renseignes dans un formulaire ou encore les prfrences de lutilisateur sagissant de la langue ou de la prsentation dun site internet, lorsque de telles options sont disponibles.</li><li>Les cookies des rseaux sociaux peuvent tre crs par les plateformes sociales pour permettre aux concepteurs de sites internet de partager le contenu de leur site sur lesdites plateformes. Ces cookies peuvent notamment tre utiliss par les plateformes sociales pour tracer la navigation des internautes sur le site internet concern, quils utilisent ou non ces cookies.</li><li>Les cookies publicitaires peuvent tre crs non seulement par le site internet sur lequel lutilisateur navigue, mais galement par dautres sites internet diffusant des publicits, annonces, widgets ou autres lments sur la page affiche. Ces cookies peuvent notamment tre utiliss pour effectuer de la publicit cible, cest--dire de la publicit dtermine en fonction de la navigation de lutilisateur.</li></ul><p style=\"margin-left:0px;\">Nous utilisons des cookies techniques. Ceux-ci sont stocks dans votre navigateur pour une priode de treize (13) mois.</p><p style=\"margin-left:0px;\">Nous utilisons des cookies des rseaux sociaux. Ces cookies ne sont dposs que si vous donnez votre accord. Vous pouvez vous informer sur leur nature, les accepter ou les refuser.</p><p style=\"margin-left:0px;\">Nous vous invitons par ailleurs  consulter les politiques de protection de la vie prive des plateformes sociales  lorigine de ces cookies, pour prendre connaissance des finalits dutilisation des informations de navigation quelles peuvent recueillir grce  ces cookies et des modalits dexercice de vos droits auprs de ces plateformes.</p><p style=\"margin-left:0px;\">Nous utilisons galement des cookies publicitaires. Ces cookies ne sont dposs que si vous donnez votre accord. Vous avez la possibilit de dsactiver ces cookies dans les paramtres de votre navigateur web.</p><p style=\"margin-left:0px;\">Nous utilisons Google Analytics, qui est un outil statistique danalyse daudience qui gnre des cookies permettant de mesurer le nombre de visites sur la Plateforme, le nombre de pages vues et lactivit des visiteurs. Votre adresse IP est galement collecte pour dterminer la ville depuis laquelle vous vous connectez. La dure de conservation de ce cookie est mentionne  larticle 7 (v) de la prsente charte.</p><p style=\"margin-left:0px;\">Nous vous rappelons  toutes fins utiles quil vous est possible de vous opposer au dpt de cookies techniques et des cookies gnrs par Google Analytics, en configurant votre navigateur. Un tel refus pourrait toutefois empcher le bon fonctionnement de la Plateforme.</p><p><i><strong>11  Consentement</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Lorsque vous choisissez de communiquer vos donnes  caractre personnel aux fins de lexcution des services que nous proposons par lintermdiaire de notre site, vous donnez expressment votre consentement pour la collecte et le traitement de celles-ci conformment  ce qui est nonc  la prsente charte et  la lgislation en vigueur.</p><p><i><strong>12  Accs  vos donnes  caractre personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Conformment  la loi n 78-17 du 6 janvier 1978 relative  linformatique, aux fichiers et aux liberts, ainsi que de RGPD, vous disposez du droit daccder  vos donnes (article 15 du RGPD) pour en obtenir la communication et le cas chant en obtenir, la rectification ou leffacement (articles 16 et 17 du RGPD),  travers un accs en ligne  votre dossier. Vous pouvez galement vous adresser  :</p><ul><li>adresse de courrier lectronique :&nbsp;<span style=\"color:rgb(124,179,66);\">espritrun80@gmail.com</span></li><li>adresse de courrier postal : <span style=\"color:rgb(0,0,0);\">ESPRIT RUN, 12 RUE FREDERIC PETIT 80000 AMIENS</span></li></ul><p style=\"margin-left:0px;\">Il est rappel que toute personne peut, pour des motifs lgitimes, demander la limitation au traitement des donnes la concernant (article 18 du RGPD) ou sopposer audit traitement (articles 21 et 22 du RGPD).</p><p style=\"margin-left:0px;\">Nous vous informerons quen cas de rectification ou effacement de vos donnes  caractre personnel, ainsi que de limitation des traitements, raliss suite  une demande de votre part, nous notifierons lesdites modifications aux personnes auxquelles nous avons communiqus vos donnes,  moins quune telle communication savre impossible (article 19 du RGPD).</p><p><i><strong>13  Portabilit de vos donnes  caractre personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Vous disposez dun droit  la portabilit des donnes  caractre personnel que vous nous aurez fournies, entendues comme les donnes que vous avez dclares activement et consciemment dans le cadre de laccs et de lutilisation des services, ainsi que des donnes gnres par votre activit dans le cadre de lutilisation des services (article 20 du RGPD). Nous vous rappelons que ce droit ne porte pas sur les donnes collectes et traites sur une autre base lgale que le consentement ou lexcution du contrat nous liant.</p><p style=\"margin-left:0px;\">Ce droit peut tre exerc gratuitement,  tout moment, et notamment lors de la fermeture de votre compte, afin de rcuprer et de conserver vos donnes  caractre personnel.</p><p style=\"margin-left:0px;\">Dans ce cadre, nous vous adresserons vos donnes  caractre personnel, par tous moyens jugs utiles, dans un format ouvert standard couramment utilis et lisible par machine, conformment  ltat de lart.</p><p><i><strong>14  Introduction dune rclamation devant une autorit de contrle</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Vous tes galement informs que vous disposez du droit dintroduire une rclamation auprs dune autorit de contrle comptente, (la Commission Nationale Informatique et Liberts pour la France), dans lEtat membre dans lequel se trouve votre rsidence habituelle, votre lieu de travail ou le lieu o la violation de vos droits aurait t commise, si vous considrez que le traitement de vos donnes  caractre personnel objet de la prsente Charte constitue une violation des textes applicables.</p><p style=\"margin-left:0px;\">Ce recours pourra tre exerc sans prjudice de tout autre recours devant une juridiction administrative ou juridictionnelle. En effet, vous disposez galement dun droit  un recours administratif ou juridictionnel effectif si vous considrez que le traitement de vos donnes  caractre personnel objet de la prsente Charte constitue une violation des textes applicables.</p><p><i><strong>15  Communication relative  une violation de donnes  caractre personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Si nous constatons une faille de scurit dans le traitement de vos donnes susceptibles dentraner un risque lev pour vos droits et liberts, nous vous en informerons dans les meilleurs dlais (article 34 du RGPD). Nous vous dtaillerons  cette occasion la nature de la violation rencontre et les mesures mise en place pour y mettre un terme.</p><p><i><strong>16  Modifications</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Nous nous rservons le droit,  notre seule discrtion, de modifier  tout moment la prsente charte, en totalit ou en partie. Ces modifications entreront en vigueur  compter de la publication de la nouvelle charte. Votre utilisation de la Plateforme suite  lentre en vigueur de ces modifications vaudra reconnaissance et acceptation de la nouvelle charte. A dfaut et si cette nouvelle charte ne vous convient pas, vous ne devrez plus accder  la Plateforme.</p><p><i><strong>17  Entre en vigueur</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">La prsente charte est entre en vigueur le&nbsp;<strong>24 Mai 2018</strong>.</p>'),
