(11, 'Agenda', '<p>Agenda du club</p><p><span style=\"color:red;\">Vendredi 11 septembre</span></p><p><span style=\"color:#2F5597;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; salon AGORA</span></p><p style=\"margin-left:3.0cm;\">Nous cherchons des volontaires pour tenir le stand de 15 heures  19 heures</p><p style=\"margin-left:3.0cm;\">&nbsp;</p><p><span style=\"color:red;\">Merdredi 16 septembre</span></p><p><span style=\"color:#4472C4;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Run2k challenge</span></p><p style=\"margin-left:3.0cm;\">Portes ouvertes au stade de camon pour faire dcouvrir le club</p><p style=\"margin-left:3.0cm;\">&nbsp;</p><p><span style=\"color:red;\">Merdredi 23 septembre</span></p><p><span style=\"color:#4472C4;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Soire piste en remplacement du relay Medley</span></p><p style=\"margin-left:3.0cm;\">au programme 1000, 1500 et 3000m<br>&nbsp;</p>');
INSERT INTO `page` (id, nom, contenu) VALUES
(12, 'Rglement', '<figure class=\"image\"><img src=\"data:image/png;base64,\"></figure><figure class=\"table\"><table><tbody><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 1 :</strong></span><span style=\"color:black;\">&nbsp;Les courses pdestres des 4 saisons d\'Amiens mtropole sont organises par le club sportif Amicale du Val de Somme, affili  la Fdration franaise d\'athltisme.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 2 :</strong></span><span style=\"color:black;\">&nbsp;Elles sont organises 4 fois par an et proposent aux participants diffrentes preuves sur des parcours dont le mesurage a t homologu officiellement par la FFA. En gnral il s\'agit d\'une preuve de 5 km et de 2 preuves de 10km selon le niveau des participants (joggers ou As). Une preuve plus courte peut tre propose pour les jeunes.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 3 :</strong></span><span style=\"color:black;\">&nbsp;Le site des comptitions se situe au parc du grand marais si le terrain le permet, des parcours de substitution peuvent tre ventuellement utiliss.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 4 :</strong></span><span style=\"color:black;\">&nbsp;Les participants doivent s\'acquitter d\'un droit d\'inscription  l\'preuve dont le montant est fix pour chaque course par le Conseil d\'administration de l\'Amicale du Val de Somme. Ils ont la possibilit de s\'inscrire via le site du club, www.valdesomme.net, sous condition de rgler leur taxe et de prsenter les justificatifs lors du retrait de dossard avant leur preuve.</span><br><span style=\"color:black;\">Pour les mineurs non licencis une autorisation parentale signe devra tre fournie.</span><br><span style=\"color:black;\">En cas de forfait, le montant de l\'inscription reste acquis  l\'organisation.</span><br><span style=\"color:black;\">L\'organisation se rserve le droit du supprimer toute inscription comportant des termes portant atteinte  l\'image ou la rputation de la course, aux bonnes murs, injurieux, racistes ou homophobes.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 5 :</strong></span><span style=\"color:black;\">&nbsp;L\'organisation s\'engage  respecter le rglement national des preuves hors stade dit annuellement par la FFA, en particulier quant au contrle des licences, des certificats mdicaux, des distances maximales autorises selon les catgories d\'ge, la prise d\'une assurance en responsabilit civile. Les coureurs licencis bnficient des garanties lies  leur licence, il importe aux autres participants de s\'assurer personnellement. Les diffrentes preuves sont inscrites au calendrier de la FFA et font l\'objet d\'un arrt prfectoral d\'autorisation.</span><br><span style=\"color:black;\">Seules les licences de la FFA, de la fdration Triathlon, et de la fdration UFOLEP athltisme ou courses sur routes sont admises.</span><br><span style=\"color:black;\">Pour les coureurs non licencis, le certificat mdical sera dat de moins d\'un an  la date de l\'preuve et comportera obligatoirement la mention de non contre-indication  la pratique de la course  pied en comptition, ou de non contre-indication  la pratique de l\'athltisme en comptition.</span><br><span style=\"color:black;\">La prsentation d\'un certificat mdical sur smartphone ou tout autre dispositif numrique lors du retrait du dossard n\'est pas autorise, l\'organisateur tant tenu de garder et archiver les certificats mdicaux.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 6 :</strong></span><span style=\"color:black;\">&nbsp;Les concurrents masculins des 10km joggers ne seront chronomtrs qu\' partir d\'une dure de course de 44 minutes. Tout concurrent de cette preuve franchissant la ligne d\'arrive en moins de 44 minutes se verra attribuer sur le classement un temps de 44 mn 00 sec.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 7 :</strong></span><span style=\"color:black;\">&nbsp;Toute contestation ou rclamation devra tre soumise au juge arbitre de l\'preuve et tudie par le jury dsign  cet effet. Les concurrents sont tenus de respecter le parcours balis et de contourner les cnes de Lubeck dans les virages. Tout concurrent n\'ayant pas respect le parcours balis dans son intgrit sera disqualifi.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 8 :</strong></span><span style=\"color:black;\">&nbsp;Les horaires des courses seront publis sur le site de l\'Amicale du Val de Somme et le bulletin d\'inscription aux preuves.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 9 :</strong></span><span style=\"color:black;\">&nbsp;En cas d\'utilisation de transpondeurs pour les classements, aucune rclamation ne sera admise pour non classement en cas de perte ou non port du transpondeur  la chaussure.</span><br><span style=\"color:black;\">La non restitution du transpondeur sera facture 10 euros au concurrent par courrier et en cas de non paiement le concurrent se verra refuser toute nouvelle inscription aux ditions suivantes.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 10 :</strong></span><span style=\"color:black;\">&nbsp;Droit d\'image : Les participants autorisent expressment l\'Amicale du Val de Somme ainsi que ses ayant-droits, tels que partenaires et mdias,  utiliser les images fixes ou audiovisuelles sur lesquelles ils pourraient apparatre, prises  l\'occasion de leur participation aux preuves des 4 Saisons d\'Amiens mtropole, sur tous les supports y compris les documents promotionnels et/ou publicitaires.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 11 :</strong></span><span style=\"color:black;\">&nbsp;Les rsultats sont publis dans les meilleurs dlais sur le site de l\'Amicale du Val de Somme puis diffuss aux supports habituels (sites du CDA80 et de Courses80).</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 12 :</strong></span><span style=\"color:black;\">&nbsp;La scurit des concurrents interdit la circulation sur le parcours  tous vhicules motoriss, sauf pour les secours d\'urgence. Une procdure de mise en place des premiers soins d\'urgence est rdige, le SAMU du CHR d\'Amiens (tl 15) peut tre mobilis rapidement sur appel.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 13 :</strong></span><span style=\"color:black;\">&nbsp;Les preuves concernent uniquement les athltes pratiquant la course  pied.</span><br><span style=\"color:black;\">Les preuves ne sont pas ouvertes aux personnes utilisant des engins handisports, des btons de marche (marche nordique), des engins  roulettes (type rollers, planches ou drivs), les engins tracts, ports ou pousss.</span><br><span style=\"color:black;\">Les chiens mme tenus en laisse ne sont pas autoriss.</span><br><span style=\"color:black;\">Les accompagnateurs en bicyclette ne sont pas autoriss sous peine de disqualification du coureur assist.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 14 :</strong></span><span style=\"color:black;\">&nbsp;L\'attribution du dossard est nominative et non cessible.</span><br><span style=\"color:black;\">Le port du dossard accroch sur le devant du maillot par des pingles est obligatoire sous peine de disqualification. Tout dossard non distinctement visible durant l\'preuve et particulirement dans les 50 derniers mtres de la course avant l\'arrive entranera une disqualification immdiate du concurrent sans possibilit de rclamation.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Rglement tabli le 07.02.2011 et valid par le conseil d\'administration de l\'Amicale du Val de Somme.</span></p></td></tr></tbody></table></figure><p>&nbsp;</p>');
